import React, { Component } from "react"
import App from "./App"

import { Header, Segment, Icon } from "semantic-ui-react"

class Main extends Component {
  render() {
    return (
      <div>

        <Header as="h2">
          <Icon name="street view" />
          <Header.Content>Welcome to Fortisure Foods</Header.Content>
        
        </Header>
        <App></App>
      </div>
    )
  }
}

export default Main
